import React, { useState } from "react";
import { Sling as HamburgerMenu } from "hamburger-react";

const Menu = () => {
  const [isOpen, setOpen] = useState(false);
  <Menu toggled={isOpen} toggle={setOpen} />;
  return <div>HamburgerMenu</div>;
};

export default Menu;
